import Navbar from "./Navbar";
import Head from "./Navbar";

const Layout = (props) => (
  <div>
    <Head>
      <title>BitPrice</title>
      <link
        rel="stylesheet"
        href="https://bootswatch.com/4/sandstone/bootstrap.min.css"
      />
    </Head>
    <Navbar />
    {props.children}
  </div>
);

export default Layout;
